  return(
    <div 
      className="menu-section"
      style={{backgroundImage: `url(${image})`,
              backgroundPosition: '50% 30%',
              backgroundSize: size
              }}
    >
      <div className="item-content">
        <h1 className="title">{gender}</h1>
        <p className="subtitle">shop now</p>
      </div>
    </div>  
  )
}

